import React, { useEffect, useState } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getNyc } from '../actions/getNyc';
import { getGaurdian } from '../actions/getGaurdian';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import DataCard from './DataCard';

const DataView = ({ getNyc, getGaurdian, nyc, gaurdian }) => {
	useEffect(() => {
		getNyc();
		getGaurdian();
	}, [getNyc, getGaurdian]);

	const nycResults = [];
	const gaurdianResults = [];

	const update = (arr, arg) => {
		arr.push(arg);
	};

	console.log(gaurdian);
	if (gaurdian && gaurdian !== null) {
		gaurdian.map((item) => {
			console.log(item.blocks.requestedBodyBlocks.body);
		});
	}
	// if (gaurdian) {
	// 	console.log(gaurdian.hasOwnProperty());
	// 	Object.entries(gaurdian.gaurdianData).map(([key, value]) => {
	// 		//console.log(typeof nycResults);
	// 		gaurdianResults.push(value);
	// 	});
	// }

	if (!nyc) {
		return;
	} else if (nyc.hasOwnProperty('nyc')) {
		Object.entries(nyc.nyc).map(([key, value]) => {
			//console.log(typeof nycResults);
			nycResults.push(value);
		});
	}

	//objFilter(nycResults, nyc);
	return <DataCard nycNews={nycResults} gaurdianNews={gaurdianResults} />;
};

const mapStateToProps = (state) => ({
	nyc: state.nyc,
	gaurdian: state.gaurdian.gaurdianData,
});

export default connect(mapStateToProps, { getNyc, getGaurdian })(DataView);
